1	Project Funds Snippet	\N	SELECT\n\n        project.id AS project_id,\n        project.title AS project_title,\n        fund.amount AS funding_value,\n        org.name AS funder_name,\n        DATE_PART('year', fund.start_date) AS start_year,\n        DATE_PART('year', fund.end_date) AS end_year,\n        fund.end_date - fund.start_date AS length_in_days\n\nFROM coped_project project\nJOIN coped_project_fund fund ON fund.id = project.id\nJOIN coped_organisation org ON org.id = fund.organisation_id\n\nWHERE 1=1\n[[ AND DATE_PART('year', fund.start_date) >= {{start_year}} ]]\n[[ AND DATE_PART('year', fund.end_date) <= {{end_year}} ]]\n;	1	t	2022-01-27 13:14:47.031384+00	2022-01-27 13:19:12.222317+00	\N
