version-info	{"latest":{"version":"v0.42.2","released":"2022-02-28","patch":true,"highlights":["Dashboards breaks when there's filters to cards that a user don't have permissions to view","Questions with Field Filter with widget type \\"None\\" will not show results","Can't combine saved questions on a dashboard card ","Setting a filter to \\"Locked\\" in Embedding question is not possible","Nested queries with long Data Model names causes failing query with incorrect aliasing","Dropdown list filtering not working, when there's nulls","BigQuery - nested query generating bad aliases, when columns are renamed in Data Model","Summarizing with implicit join does not allow subsequent joins and nested query","Databases shows sync-spinner and doesn't allow to remove it or do a forced sync"]},"older":[{"version":"v0.42.1","released":"2022-02-17","patch":true,"highlights":["Filter dropdown only allows filtering on \\"starts with\\"","Unable to filter dashboards for dashboard subscription emails","Dashboard filter with defaults, doesn't work if values are removed, query fails","Pulse Question Alert to Slack sending cropped images","Cannot remove Google Sign-in setup","Embed dashboard Field Filter cannot work when choosing single option","Custom expression - Count needs parentheses, but deletes them afterwards","Cannot open Model sidebar in some cases","BigQuery incorrectly aliasing, which can make the query fail","Filtering on nested questions causes error in Public and Embedding","BigQuery nested query with ambiguous columns causes error","Setting a filter to \\"Locked\\" in Embedding is not possible","Remove unused dep on aleph (and thus unused transient dep on Netty)","Oracle queries don't work when aliases (auto-generated or otherwise) contain double quotes or null characters","When no-data user views a nested question, then all editing options are exposed","When no-data user views a nested question, then \\"Ask question\\" and \\"Browse data\\" appears","Oracle fails queries on joins with tables with long display names","Pivot Table: Cannot change name of fields used for \\"values\\""]},{"version":"v0.42.0","released":"2022-02-08","patch":false,"highlights":["Waterfall static viz default settings","\\"By coordinates\\" map in People X-ray shows a nonsensical pin map","Pins do not appear on pin map","\\"Explore results\\" shown for no-data users resulting in blank screen when clicked","Blank screen when accessing Models with no-data user","Secret connection property file path is not retained when revisiting database edit page","Licensing page goes into reload-loop if token is expired","Descriptions missing in search results"," the Time picker AM and PM color can not be distinguished obviously","Horizontal scroll of pinned table doesn't work on Firefox","Metadata tooltip popup on colum header casues data table to reset for number columns that are all NULLs ","Certain visualization_settings can cause empty/missing columns on export","Postgres unnecessarily casts `timestamptz` and `date` columns to `timestamp` inside `date_trunc()` ","Alert Stopped email is Unhelpful","Exports ignore column ordering regression in v0.41.6","Premature calls to `to-sql` inside `sql.qp/->honeysql` methods","Visualization \\"auto-viz\\" doesn't keep existing settings, when changing fields returned","Can't add a filter if the value isn't in the field filters dropdown","Clean up database guide usability during configuration","defsetting `:tag` metadata should be on the arglists themselves, not the var","Clean up how we show deprecated database drivers","SQLite/Redshift/SQL Server/MySQL queries don't work correctly with multiple column aliases with same name but different case","Archived sub-collections are still showing in Permissions","Clean up how we show deprecated database drivers","XLSX exports are leaving temporary files, which can block instance from working","Add a way to return to previous page from sign in cases","Consolidate first db sync modal and X-ray selection","[Epic] Migrate Slack implementation from Bot to App","Improve Filters for 42","Clean Up Settings Navigation"]},{"version":"v0.41.6","released":"2022-01-14","patch":true,"highlights":["Specific visualization_settings can cause empty export","Cannot change Field Filter reference to another schema/table if viewing the question directly","Upgrade Log4j to 2.17.1","Names of schemas or namespaces in the Data Model should wrap","Broken layout on Data Model page on locales with longer text"]},{"version":"v0.41.5","released":"2021-12-16","patch":true,"highlights":["Upgrade Log4j to 2.16.0","X-rays fails if there's a filter in the question","XLSX export does not respect \\"Separator style\\"","One cannot change any of the LDAP Settings once it's been initially setup","Custom Expression `coalesce` is using wrong field reference when nested query","Custom Expression `case` is using wrong field reference when nested query","Dashboard causes permission error, when \\"Click Behavior\\" linking to dashboard/question without access","Site URL validation too strict, doesn't accept underscore","Reverse proxy reset email should use site URL in email body and not localhost"]},{"version":"v0.41.4","released":"2021-12-10","patch":true,"highlights":[]},{"version":"v0.41.3.1","released":"2021-12-02","patch":true,"highlights":["BigQuery and Google Analytics drivers broken on x.41.3","BigQuery connection error on 0.41.1"]},{"version":"v0.41.3","released":"2021-12-01","patch":true,"highlights":["Static viz creates Picaso painting, when data is unordered Timeseries","Harmonize Google dependency versions, which could cause conflict between GA and new BigQuery driver","Saving/updating questions can take a very long time (seconds or minutes) on large instances","Funnel chart showing retained NaN% when all rows from aggregate column are zero","Changing a (old) pivoted table to less than 3 columns results in blank screen","Exports fails, when there's invalid visualization `column_